var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro header item test object.
 * @param {Object} [props] Initializes a UIAPro header item test object using the supplied property bag.
 * @returns {HeaderItem} the description object that was initialized.
 * @class HeaderItem
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function HeaderItem(props) {
    var headerItemDesc = new UiObjectBaseDescription("HeaderItem");

    headerItemDesc._defineByPropertyBag(props);
    return headerItemDesc;
}

/**
 * A UIAPro header item.
 * @constructor
 * @class HeaderItemTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function HeaderItemTO(session, description) {
    description = description || HeaderItem();
    var headerItemTO = new UiObjectBaseTO("UIAProHeaderItem", session, description);
    
    return headerItemTO;
}

module.exports.HeaderItemTO = HeaderItemTO;
module.exports.HeaderItem = HeaderItem;